class App extends React.Component {
  constructor() {
    super();

    this.state = {
      clicked: false
    };

    this.handleClick = this.handleClick.bind(this);
  }

  handleClick() {
    this.setState({
      clicked: true
    });
  }

  render() {
    return (
      <div>
        <button onClick={this.handleClick}>Click Me</button>
        {this.state.clicked ? <NewComponent /> : null}
      </div>
    );
  }
};

